class Solution {

    /**
     * @param Integer[] $nums
     * @param Integer $target
     * @return Integer
     */
    function minSizeSubarray($nums, $target) {
        $n = count($nums);
        $sum = array_sum($nums);
        if ($sum < $target) return -1; // Early exit if total sum is less than target

        $prefixSums = [0];
        for ($i = 0; $i < $n * 2; $i++) {
            $prefixSums[] = $prefixSums[$i] + $nums[$i % $n];
            if ($prefixSums[$i + 1] >= $target) break; // No need to continue if we already have enough sum
        }

        $minLength = PHP_INT_MAX;
        $left = 0;
        for ($right = 1; $right < count($prefixSums); $right++) {
            while ($prefixSums[$right] - $prefixSums[$left] >= $target) {
                $minLength = min($minLength, $right - $left);
                $left++;
            }
        }

        return $minLength === PHP_INT_MAX ? -1 : $minLength;
    }
}
